import React, { useState } from "react";
import cl from "./Home.module.css";
import InputMask from "react-input-mask";

const Home = () => {
  const [modal, setModal] = useState(false);

  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [message, setMessage] = useState("");
  const [emailError, setEmailError] = useState(false);
  const [sendConfirm, setSendConfirm] = useState(false);

  async function sendMessage() {
    const data = [];
    data.push({
      name,
      phone,
      email,
      message,
    });

    var validRegex =
      /^[a-zA-Z0-9.!#$%&'*+/=?^_`{|}~-]+@[a-zA-Z0-9-]+(?:\.[a-zA-Z0-9-]+)*$/;
    if (email != undefined && email.toLowerCase().match(validRegex)) {
      setEmailError(false);
      setEmail("");

      const response = await fetch(
        "https://api.steelcom-jdh.ru/api/user-message",
        {
          method: "POST",
          body: JSON.stringify(data),
          headers: {
            "Content-Type": "application/json",
          },
        }
      );

      setModal(true);
      setTimeout(() => {
        setModal(false);
      }, 1500);
    } else {
      setEmailError(true);
    }
  }

  return (
    <div class={cl.HomeMainContainer}>
      <section className={cl.EcommerceContainer}>
        <h1>Электронная коммерция</h1>
      </section>
      <section className={`container-fluid ${cl.contactFormContainer}`}>
        <div className="row">
          <div className="col-12">
            <h2 className={cl.callbackFormTitle}>
              Остались вопросы? Свяжитесь с нами!
            </h2>
            <div className={cl.formCase}>
              <div className={cl.formInput} style={{ marginBottom: 20 }}>
                <label>Имя</label>
                <input
                  type="text"
                  name="name"
                  id="full-name"
                  placeholder="Имя"
                  value={name}
                  onChange={(e) => {
                    setName(e.target.value);
                  }}
                />
              </div>
              <div className={cl.formInput} style={{ marginBottom: 20 }}>
                <label>Email</label>
                <input
                  type="email"
                  name="_replyto"
                  id="email-address"
                  placeholder="Email"
                  value={email}
                  onChange={(e) => {
                    setEmail(e.target.value);
                  }}
                />
                {emailError ? (
                  <label className={cl.errorEmail}>
                    Некорректный email. Все хорошо?
                  </label>
                ) : null}
              </div>
              <div className={cl.formInput} style={{ marginBottom: 20 }}>
                <label>Телефон</label>
                <InputMask
                  mask="+9 (999) 999-99-99"
                  placeholder="+7 (000) 000-00-00"
                  maskChar={null}
                  value={phone}
                  onChange={(e) => setPhone(e.target.value)}
                />
              </div>
              <div className={cl.formInput} style={{ marginBottom: 20 }}>
                <label>Сообщение</label>
                <textarea
                  type="text"
                  name="message"
                  id="message"
                  className={cl.textarea}
                  placeholder="Сообщение"
                  value={message}
                  onChange={(e) => {
                    setMessage(e.target.value);
                  }}
                ></textarea>
              </div>

              <button
                type="submit"
                className={cl.formButton}
                onClick={() => sendMessage()}
              >
                Отправить
              </button>
            </div>
          </div>
        </div>

      </section>
    </div>
  );
};

export default Home;
